import React, { useEffect, useState, useRef } from 'react';
import { useUserContext } from './UserContext';
import './AsteroidDefenseGame.css';
import { useTranslation } from 'react-i18next';
import { useHighContrast } from './HighContrastContext';

// Simple arcade-style asteroid defense game using real NEO data
const GAME_DURATION = 60; // seconds

function getRandomInt(min, max) {
  return Math.floor(Math.random() * (max - min + 1)) + min;
}

// Voice narration for asteroid facts and game events
function speak(text, lang = 'en') {
  if ('speechSynthesis' in window) {
    const utter = new window.SpeechSynthesisUtterance(text);
    utter.lang = lang;
    window.speechSynthesis.speak(utter);
  }
}

const AsteroidDefenseGame = () => {
  const { t } = useTranslation();
  const { addBadge, addLogEntry } = useUserContext();
  const { highContrast } = useHighContrast();
  const [asteroids, setAsteroids] = useState([]);
  const [score, setScore] = useState(0);
  const [facts, setFacts] = useState([]);
  const [gameOver, setGameOver] = useState(false);
  const [timer, setTimer] = useState(GAME_DURATION);
  const [showFact, setShowFact] = useState(null);
  const intervalRef = useRef();

  useEffect(() => {
    fetch('/api/neo?start_date=2025-06-18&end_date=2025-06-18')
      .then(res => res.json())
      .then(data => {
        const neos = Object.values(data.near_earth_objects).flat();
        setAsteroids(neos.slice(0, 10).map(neo => ({
          ...neo,
          x: getRandomInt(10, 90),
          y: 0,
          speed: getRandomInt(1, 3)
        })));
        setFacts(neos.map(neo => `${neo.name}: ${neo.nasa_jpl_url}`));
      });
  }, []);

  useEffect(() => {
    if (gameOver) return;
    intervalRef.current = setInterval(() => {
      setAsteroids(asts => asts.map(a => ({ ...a, y: a.y + a.speed })));
      setTimer(t => {
        if (t <= 1) {
          setGameOver(true);
          clearInterval(intervalRef.current);
          addLogEntry('Asteroid Defense Game completed!');
          addBadge('Asteroid Defender');
          return 0;
        }
        return t - 1;
      });
    }, 500);
    return () => clearInterval(intervalRef.current);
  }, [gameOver, addBadge, addLogEntry]);

  const handleAsteroidClick = idx => {
    setScore(s => s + 1);
    setShowFact(facts[idx]);
    setAsteroids(asts => asts.filter((_, i) => i !== idx));
  };

  const { i18n } = require('react-i18next');

  useEffect(() => {
    if (showFact) {
      speak(showFact, i18n.language);
    }
  }, [showFact, i18n.language]);

  useEffect(() => {
    if (gameOver) {
      speak(t('gameOver') + '! ' + t('finalScore') + ': ' + score, i18n.language);
    }
  }, [gameOver, score, t, i18n.language]);

  return (
    <div className={`asteroid-game${highContrast ? ' high-contrast' : ''}`} aria-label={t('asteroidDefenseGame')}>
      <h2>{t('asteroidDefenseGame')}</h2>
      <div className="game-area" tabIndex={0} aria-label={t('gameArea')}>
        {asteroids.map((a, i) => (
          <div
            key={a.id}
            className="asteroid"
            style={{ left: `${a.x}%`, top: `${a.y}%` }}
            tabIndex={0}
            aria-label={t('asteroid') + ' ' + a.name}
            onClick={() => handleAsteroidClick(i)}
            onKeyDown={e => (e.key === 'Enter' || e.key === ' ') && handleAsteroidClick(i)}
          >
            🪨
          </div>
        ))}
      </div>
      <div className="scoreboard">
        {t('score')}: {score} | {t('timeLeft')}: {timer}s
      </div>
      {showFact && (
        <div className="fact-popup" role="dialog" aria-modal="true">
          <p>{showFact}</p>
          <button onClick={() => setShowFact(null)}>{t('close')}</button>
        </div>
      )}
      {gameOver && <div className="game-over">{t('gameOver')}! {t('finalScore')}: {score}</div>}
    </div>
  );
};

export default AsteroidDefenseGame;
